!function(){"use strict";$.get("/admin/plugins-market/check",function(n){n.enabled&&((n.count.release>0||n.count.pre>0)&&$("ul.nav").prepend('\n                <li class="dropdown notifications-menu">\n                    <a href="#" class="dropdown-toggle" data-toggle="dropdown">\n                        <i class="fa fa-plug"></i>\n                        <span>'+(n.count.release+n.count.pre)+'</span>\n                    </a>\n                    <ul class="dropdown-menu">\n                        <li>\n                            <ul class="menu" id="plugin-update-menu"></ul>\n                        </li>\n                    </ul>\n                </li>\n    '),n.count.release>0&&$("ul#plugin-update-menu").append('\n                <li>\n                    <a href="'+n.url+'" title="'+trans("market.check.new",{count:n.count.release.toString()})+'">\n                        <i class="fa fa-plug text-green"></i>'+trans("market.check.new",{count:n.count.release.toString()})+"\n                    </a>\n                </li>\n    "),n.count.pre>0&&$("ul#plugin-update-menu").append('\n                <li>\n                    <a href="'+n.url+'" title="'+trans("market.check.pre",{count:n.count.pre.toString()})+'">\n                        <i class="fa fa-plug text-yellow"></i>'+trans("market.check.pre",{count:n.count.pre.toString()})+"\n                    </a>\n                </li>\n    "))})}();
